// OutputComponent.js
import React, { useState, useEffect } from 'react';

const OutputComponent = ({ location }) => {
  const [outputValues, setOutputValues] = useState({
    output1: '',
    output2: '',
    output3: '',
  });

  useEffect(() => {
    const receivedData = location.state.updatedData;

    if (receivedData && receivedData.length === 3) {
      setOutputValues(prevState => ({
        ...prevState,
        output1: String(receivedData[0]),
        output2: String(receivedData[1]),
        output3: String(receivedData[2]),
      }));
    }
  }, [location.state.updatedData]);

  return (
    <div>
      <label>Output Number 1: </label>
      <input type="text" value={outputValues.output1} readOnly />
      <br />
      <label>Output Number 2: </label>
      <input type="text" value={outputValues.output2} readOnly />
      <br />
      <label>Output Number 3: </label>
      <input type="text" value={outputValues.output3} readOnly />
    </div>
  );
};

export default OutputComponent;
